which aids in the placement of eligible candidates. ICA Edu Skills Shantipuram center has certain eligibility criteria and guidelines to apply for Job- Guaranteed courses. For more details enquire now.</p>', '<ul>\r\n<li>100% Guaranteed Placement&nbsp;</li>\r\n<li>Presence in over 100 Cities</li>\r\n<li>Regular Seminars and Grooming sessions</li>\r\n<li>Expert CA Faculty</li>\r\n<li>Practical Training</li>\r\n<li>Soft Skills Training</li>\r\n<li>Triple Certification (<a href=\"https://www.nsdcindia.org/tphubdetails?getdata=MTI4\">ICA- NSDC</a>, SAP, Microsoft Office)</li>\r\n<li>Mock Interview Sessions</li>\r\n<li>Any Time Job Card</li>\r\n<li>70000+ Registered Employers</li>\r\n<li>30+ Placement Offices</li>\r\n<li>22+ Years of Educational Excellence</li>\r\n</ul>', 'allahabadshantipuram.center@icagroup.in', '7376677378', '7376677378', 'G97, 2nd Floor, Shantipuram Awas Yojna, Near HDFC Bank, Shantipuram, Allahabad, 211013', '<p><iframe style=\"border: 0;\" src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7200.326727259365!2d81.85131751615008!3d25.532934717403382!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x399ac9a60fd0a5ed%3A0x997e264a77ac31f0!2sICA%20Edu%20Skills%20%7C%20Allahabad%20Shantipuram!5e0!3m2!1sen!2sin!4v1676701925392!5m2!1sen!2sin\" width=\"100%\" height=\"450\" allowfullscreen=\"\" loading=\"lazy\"></iframe></p>', '[\"1\",\"7\"]', 33, 1565, '[\"711523\",\"711524\",\"711525\"]', 211013, 25.533306, 81.854218, NULL, 1, 'Accounts GST Tally SAP Course Shantipuram- Enroll with India\'s No.1 Educational Training Institute. Enquire now For more details about ICA courses and placement', '<script type=\"application/ld+json\">\r\n{\r\n \"@context\": \"https://schema.org\",\r\n \"@type\": \"CollegeOrUniversity\",\r\n \"name\": \"ICA Edu Skills | Shantipuram\",\r\n \"url\": \"https://www.icajobguarantee.com/centers/accounts-gst-tally-sap-course-allahabad-shantipuram/\",\r\n \"logo\": \"https://www.icajobguarantee.com/wp-content/uploads/2019/09/logo.png\",\r\n \"co