(1, '1', 'Certified Industrial Accountant', 'Certified Industrial Accountant | ICA Edu Skills', 'accounts-course', NULL, NULL, '<p>Learn the most industry demand Accounts | GST | TallyPrime | SAP FICO courses \"At A Go\"- CIA or Certified Industrial Accountant is the most popular training program in India for aspiring accounting and finance professionals. As it covers most of the topics and practical training modules, this course is acknowledged as one of the best accounting courses to support you with a placement facility. After completing this financial accounting course, you can join multiple job roles in the field of accounting, finance, and taxation. Certified Industrial Accounts training equips candidates with Accounts | GST | TallyPrime | SAP FICO along with Direct Tax, and more. Interested To Know More? Speak To Our Expert Academic Counselor Now!</p>\r\n<p>The accounting and finance industry is a diverse field with a wide range of positions. Due to this variety, there are many different job titles to consider if you are interested in a career in this industry. Before starting a job search, it is important to understand all of the available job titles so that you can choose the best career path for you. In this article, we discuss the requirements for working in accounting and explore various job titles in the field.</p>', 'Learn the most industry demand Accounts | GST | TallyPrime | SAP FICO courses \"At A Go\"- CIA or Certified Industrial Accountant is the most popular training program in India for aspiring accounting and finance professionals. As it covers most of the topics and practical training modules, this course is acknowledged as one of the best accounting courses to support you with a placement facility...', NULL, NULL, '12 Months', '7', '<ul>\r\n<li>Business Computer Applications</li>\r\n<li>Business Accounting</li>\r\n<li>TallyPrime</li>\r\n<li>Business Communication</li>\r\n<li>Direct Tax</li>\r\n<li>GST</li>\r\n<li>Advanced Accounts</li>\r\n</ul>', '<ul>\r\n<li>Eligibility: 12+/Graduate</li>\r\n</ul>', 9845, 8987, '[\"1\",\"2\",\"3\",\"5\",\"4\"]', 1, 'Learn the most industry demand Accounts | GST | TallyPrime | SAP FICO courses \"At A Go\"- CIA or Certified Industrial Accountant is the most popular training program in India for aspiring accounting and finance professionals. As it covers most of the topics and practical training modules, this course is acknowledged as one of the best accounting courses to support you with a placement facility', NULL, 'index, follow', NULL, 'CIA-Google-Organic', 'SEO', 1, '2023-02-13 06:33:25', '2023-04-11 07:14:25'),
(2, '4', 'Diploma in Financial Markets (DFM)', 'Diploma in Financial Markets (DFM) | ICA Edu Skills', 'best-financial-market-course', NULL, NULL, '<p>Join India&rsquo;s 1st industry-oriented Financial Market course supported by experienced and certified trainers and mentors. By 2025, the <a href=\"https://economictimes.indiatimes.com/news/economy/indicators/india-poised-to-become-5-trillion-economy-by-2024-25-puri/articleshow/87185563.cms\">Indian Economy is estimated to reach 5 trillion USD</a> and currently, there are 44 Asset Management Cos (AMCs), 20 million unique investors in the field, and 24 Life Insurance companies in India. With huge career prospects in the financial markets, now is the best time to tap into the best possible opportunity by enrolling in the best financial market course. ICA Edu Skill&rsquo;s Diploma in Financial Markets is an industry-ready course backed by 22+ years of experience, annual <a href=\"https://www.icajobguarantee.com/accounts-gst-sap-tally-career-opportunities/\">placement of 2,00,000+ students</a>, and strong placement background. Career opportunities are ample when you suit-up with a power package called Diploma Finance Course. DFM (Diploma in Financial Markets) is purposed for enthusiastic graduates looking for a well-positioned career in Financial Planning &amp; Advisory, Business Development Executive, Mutual Fund Specialist, Equity Derivatives &amp; Acquisition Executives. The Objective of the course is to equip the participant with necessary stock market theoretical and practical know-how so that students can apply the same in researching equity markets for wealth creation. It introduces you to the process of how to find and analyze companies, determine the risk of a stock investment or trade, proper entry and exit time of the stock, understand why markets move the way they do, and helps you choose the right trading style for your personal goals using correct approach to financial planning. If you\'re new to the stock market and want to know the basics, this is the tutorial for you!</p>', NULL, NULL, NULL, '6 Months', '9', '<ul>\r\n<li>Financial Markets Beginner&rsquo;s Module</li>\r\n<li>Derivatives Market Dealers Module</li>\r\n<li>Macro Economics</li>\r\n<li>Technical Analysis</li>\r\n<li>Fundamental Analysis</li>\r\n<li>Currency, Commodity</li>\r\n</ul>', '<ul>\r\n<li>Eligibility: 12+/Graduate</li>\r\n<li>Total Duration: 6 Months</li>\r\n<li>Course Type: Job Assistance</li>\r\n</ul>', 5898, 2565, NULL, 1, 'Join India’s 1st industry-oriented Financial Market course supported by experienced and certified trainers and mentors. By 2025, the Indian Economy is estimated to reach 5 trillion USD and currently', NULL, 'index, follow', NULL, 'DFM-Google-Organic', 'SEO', 1, '2023-02-21 04:56:34', '2023-02-21 04:56:34'),
(3, '1', 'Certified Industrial Accountant with SAP FICO', 'Certified Industrial Accountant with SAP FICO | ICA Edu Skills', 'certified-industrial-accountant-sap', NULL, NULL, '<p>CIA or Certified Industrial Accountant is the most popular accounting taxation course in India for aspiring accounting and finance professionals. As it covers most of the topics and practical training modules, this course is acknowledged as one of the best accounting taxation course to support you with a placement facility. After completing this financial accounting course, you can <a href=\"https://www.indiatoday.in/education-today/jobs-and-careers/story/career-as-an-accountant-job-role-growth-prospects-and-why-it-s-such-a-satisfactory-profession-1628750-2019-12-16\">join multiple job roles</a> in the field of accounting, finance, and taxation. <a href=\"https://www.icajobguarantee.com/business-accounting-taxation-courses-for-everyone/\">Certified Industrial Accounts training</a> equips candidates with Accounts training, Direct Tax, GST, Tally ERP, and more...</p>\r\n<p><a class=\"thm-btn bg-thm-color-three thm-color-three-shadow btn-rectangle open-popup-link\" href=\"https://www.icacourse.in/courses/certified-industrial-accountant-sap/\" target=\"_blank\" rel=\"noopener\">View Online Course</a></p>\r\n<p>In every business, daily journals, ledgers, Bank Reconciliation statements, Profit and Loss statements and income and balance sheets present an unbiased picture of the financial position of an organization. They tell the true position with regard to its liabilities, cash sources, viability of managerial and investor decisions and compliance with taxation and corporate laws. Thus, good Accountants are a need everywhere.</p>\r\n<p>According to payscale.com, the top salary for an accountant, not being a Chartered Accountant, could go up to Rs. 4,87,303 a year.</p>\r\n<p>There is steady and assured growth for an accountant over the progression of her career. Experience affects accountant salaries markedly.</p>\r\n<p>Most accountants become record-keepers, especially at the entry-level. However, they are supposed to check and maintain calculations, create sales and cash flow reports, administer payrolls, prepare balance sheets, carry out billing activity, manage budgets and inventory.</p>\r\n<p>At a mid to senior level, the accountant may also be expected to file taxes or go through historical reports to create turnover forecasts.</p>', NULL, NULL, NULL, '18 Months', '13', '<ul>\r\n<li>Business Computer Applications</li>\r\n<li>Business Accounting</li>\r\n<li>TallyPrime</li>\r\n<li>Business Communication</li>\r\n<li>Direct Tax</li>\r\n<li>GST</li>\r\n<li>Advanced Accounts</li>\r\n<li>Additional Accounting Package</li>\r\n<li>Advanced MS Excel</li>\r\n<li>SAP(FICO)</li>\r\n<li>Banking and Auditing</li>\r\n<li>MCA (Including XBRL and LLP)</li>\r\n<li>Ind AS</li>\r\n</ul>', '<ul>\r\n<li>Eligibility: 12+/Graduate</li>\r\n<li>Total Duration: 18 Months</li>\r\n<li>Course Type: 100% Job Guarantee</li>\r\n</ul>', 4567, 6589, NULL, 1, 'CIA or Certified Industrial Accountant is the most popular accounting taxation course in India for aspiring accounting and finance professionals. As it covers most of the topics and practical training', NULL, 'index, follow', NULL, 'CIA-Plus-Google-Organic', 'SEO', 1, '2023-02-22 07:14:09', '2023-02-22 07:14:09'),
(4, '1', 'Certified Industrial Accountant Express', 'Certified Industrial Accountant Express | ICA Edu Skills', 'best-accounts-finance-banking-courses', NULL, NULL, '<p>Now YOU can be job-ready within 4 months. Here&rsquo;s your window of opportunity to Be Certified from India&rsquo;s No.1 <a href=\"https://www.icajobguarantee.com/accounts-course-to-build-your-niche-in-finance/\">Accounts &amp; Finance Training Institute</a> - ICA Edu Skills. Join Best Accounts Finance Banking Courses &amp; learn from the comfort of your home and get placed with our Fast-Track 100% Job Guaranteed Courses. Enhance your resume, gain real-time experience and be market-ready through ICA&rsquo;s <a href=\"https://www.tribuneindia.com/news/jobs-careers/these-short-term-accounts-courses-will-help-you-build-your-niche-in-finance-246809\">Short Term Accounting Course</a> during the COVID pandemic.</p>\r\n<p>Accounting in real terms involves handling real avenues, transactions and finances. Opting for short-term certified Best Accounts Finance Banking Courses provide the requisite skills and knowledge needed for a variety of industries and businesses. Such courses are also high in demand during such highly unprecedented times. These courses impart in-depth accounting training, soft skills development, job-grooming, practical training through the industry-based study modules. Students get a hands on knowledge of accounting through subjects, including Business Computer Application, Business Accounting, TallyPrime, Business Communication, Direct Taxes, TDS, GST, Advanced Account, Additional Accounting Package, Advanced MS Excel, SAP, Banking and Auditing and more. All of these skills contribute to the skills and knowledge necessary for job adaptation in the accountancy sector. In the short-term courses more emphasis has been given on practical knowledge than the theoretical one. Students right away gain knowledge through live-training sessions</p>', NULL, NULL, NULL, '8 Months', '6', '<ul>\r\n<li>Business Computer Applications</li>\r\n<li>Business Accounting</li>\r\n<li>TallyPrime</li>\r\n<li>Business Communication</li>\r\n<li>TDS</li>\r\n<li>GST</li>\r\n</ul>', '<ul>\r\n<li style=\"text-align: left;\"><span style=\"font-weight: 400;\">Eligibility: </span><strong>12+/Graduate</strong></li>\r\n<li style=\"text-align: left;\"><span style=\"font-weight: 400;\">Total Duration:</span><strong> 8 Months</strong></li>\r\n<li style=\"text-align: left;\"><span style=\"font-weight: 400;\">Course Type : </span><strong>100% Job Guarantee (For Classroom)</strong></li>\r\n</ul>', 1112, 8974, '[\"1\"]', 1, 'Now YOU can be job-ready within 4 months. Here’s your window of opportunity to Be Certified from India’s No.1 Accounts & Finance Training Institute - ICA Edu Skills. Join Best Accounts Finance Banking…', NULL, 'index, follow', NULL, 'CIA-Express-Google-Organic', 'SEO', 1, '2023-02-22 07:20:28', '2023-04-11 07:02:55'),
(5, '7', 'Microsoft Certification', 'Microsoft Certification | ICA Edu Skills', 'mis-microsoft-excel-office-courses', NULL, NULL, '<p>MIS Microsoft Excel Office Courses is one of the best professional training program. Get the <a href=\"https://www.icajobguarantee.com/benefits-of-microsoft-office-specialist-certification-courses/\">advantage of the Microsoft Office certification course</a> and enhance your technical knowledge on various Microsoft tools and technological know-how. According to the latest survey conducted by Microsoft, about 25% of Microsoft Office Specialists have received a salary hike of over 20%. This globally recognised program will not only be an effective add-on to your existing skills but also ensure you are placed in MNCs and top companies due to the <a href=\"https://www.indeed.com/career-advice/career-development/microsoft-certification-training\">high demand for Microsoft Office specialists</a> in the market.</p>\r\n<p>This MIS Microsoft Excel Office Courses will give you a detailed knowledge on MIS, MS Word, Microsoft Excel, PowerPoint etc. If you pass the Microsoft office certification exam, you will get an edge over the other students who are competing with you to crack an interview. This course will give you the following benefits - Get hired&mdash;faster, Get recognized, Get rewarded, Get promoted &amp; Satisfaction. Ninety-five percent of professionals believe that this certification adds value to an organization and&nbsp; make employees more productive in their roles, teams drive more innovation, and the recruiting and hiring process become simplified.</p>\r\n<p>Whether you want to advance your career, or simply increase your skills and productivity in the world&rsquo;s prominent business technologies, Microsoft Office Specialist certifications validate the expertise you need to succeed.</p>', NULL, NULL, NULL, '48 Hours', '1', '<ul>\r\n<li>Database Design</li>\r\n<li>Cell Reference</li>\r\n<li>Number Conditional Formatting</li>\r\n<li>Lookup Reference Functions</li>\r\n<li>Protection</li>\r\n<li>Mail Merge</li>\r\n<li>Google Drive</li>\r\n<li>Logical Functions</li>\r\n<li>Financial Functions</li>\r\n<li>Sort Filter</li>\r\n<li>Pivot Table Pivot Chart</li>\r\n</ul>', '<ul>\r\n<li>Eligibility: 12+/Graduate</li>\r\n<li>Total Duration: 48 Hours</li>\r\n<li>Course Type: Short Term Course</li>\r\n</ul>', 5464, 8974, NULL, 1, NULL, NULL, 'index, follow', NULL, 'Google-Organic', 'SEO', 1, '2023-03-01 02:25:00', '2023-03-01 02:25:00'),
(6, '4', 'NSE Academy Certified Capital Market Professional (NCCMP)', 'Stock Market Certification Course (NCCMP): ICA EduSkills', 'best-stock-market-certification-course', NULL, NULL, '<p>NSE Academy Certified Capital Market Professional (NCCMP) is a professionally designed short-term course. This stock market certification course is jointly certified by <a href=\"https://www.nseindia.com/learn/overview-about-nse-academy\" target=\"_blank\" rel=\"noopener\">NSE Academy</a> &amp; <a href=\"https://www.icajobguarantee.com/about-us/\" target=\"_blank\" rel=\"noopener\">ICA Edu Skills</a>. After the completion of the course, you will have an in-depth understanding of how the capital market&nbsp; and its instruments functions.</p>\r\n<p>This stock market certification course is one of the best one available in the market, covering a wide range of concepts in financial markets and their instruments like Equities and Derivatives. Not only that, you will also learn to study several macroeconomic factors that drive the capital market. In addition, this course emphasizes on teaching Fundamental Analysis as well as Technical Analysis.</p>\r\n<p>Fundamental analysis will help you understand the step-by-step process by which investors are able to pick the right stock. With Technical analysis, you learn a time-tested procedure of making timely entries and exits in stocks after doing a detailed study of charts.</p>\r\n<h3>Why should you do the NCCMP course?</h3>\r\n<p>The objective of this NSE certification course is to help you develop the necessary theoretical and practical knowledge in the stock market. This will help you in conducting the necessary market research for short and long term wealth creation.</p>\r\n<h3>Who should do this stock market certification course?</h3>\r\n<ul>\r\n<li>Candidates who want to gain a thorough knowledge of financial markets</li>\r\n<li>Who wants to manage his/her own money as an investor and retail trader.</li>\r\n<li>Is a student of professional courses</li>\r\n<li>Is in the financial service industry as professional</li>\r\n</ul>', NULL, NULL, NULL, '3 Months', '5', '<ul>\r\n<li>Financial Markets Beginner&rsquo;s</li>\r\n<li>Macro Economics</li>\r\n<li>Fundamental Analysis</li>\r\n<li>Technical Analysis</li>\r\n</ul>', '<ul>\r\n<li style=\"text-align: left;\">Eligibility: 12+/Graduate</li>\r\n<li style=\"text-align: left;\">Total Duration: 3 Months</li>\r\n</ul>', 5658, 2549, NULL, 1, 'NSE Academy Certified Capital Market Professional (NCCMP) is the best stock market certification course to understand the functioning of the capital market.', NULL, 'index, follow', NULL, 'NCCMP-Google-Organic', 'SEO', 1, '2023-03-01 04:51:46', '2023-03-01 04:51:46'),
(7, '3', 'Post Graduation Program in Artificial Intelligence & Machine Learning', 'Post Graduation Program in Artificial Intelligence & Machine Learning | ICA Edu Skills', 'pg-diploma-in-al-ml', NULL, NULL, '<p><span style=\"color: #242222; font-family: Roboto, sans-serif; font-size: 14px; background-color: #ffffff;\">In the data-driven world, Artificial Intelligence and Machine Learning are becoming the most in-demand career option. Artificial Intelligence and Machine Learning are the studies of data. It involves developing methods of recording, storing, and analyzing data to effectively extract useful information. The goal of\\ndata science is to gain insights and knowledge from any type of data &mdash; both structured and\\nunstructured. It involves the use of tools/technologies for managing large amounts of data, statistical techniques to analyze and interpret this data, and an understanding of domains such as finance, marketing, and pharma which provides the context for such analysis. In the data-driven world, Artificial Intelligence and Machine Learning are becoming the most in-demand career option. Artificial Intelligence and Machine Learning are the studies of data. It involves developing methods of recording, storing, and analyzing data to effectively extract useful information. The goal of data science is to gain insights and knowledge from any type of data &mdash; both structured and unstructured. It involves the use of tools/technologies for managing large amounts of data, statistical techniques to analyze and interpret this data and an understanding of domains such as finance, marketing, and pharma which provides the context for such analysis.</span></p>', 'In the data-driven world, Artificial Intelligence and Machine Learning are becoming the most in-demand career option. Artificial Intelligence and Machine Learning are the studies of data.', NULL, NULL, '260 Hours', '12', '<ul>\r\n<li>Microsoft Excel</li>\r\n<li>Statistics</li>\r\n<li>R Language</li>\