(17, 1, 'Business Computer Applications', '48', NULL, '<p>Business Computer Application (BCA) module helps the student to understand the use of standard software programs used in workplace.<br /><br /><strong>Learning Outcomes:<br /></strong>Organizing data, structuring, and reporting,MIS using spreadsheets,Writing e-mails and drafting various documents,Management Presentation,Digitizing of standard office environments (G-Suite)</p>\r\n<p>&nbsp;</p>', NULL, '[\"Hardware & Software\",\"Working with Windows 10\",\"File & Folder Management\",\"Introduction to MS Word 2016\",\"Page Set up Drafting & Formatting Documents\",\"Tables\",\"Header & Footer\",\"Number & Conditional Formatting\",\"Database design\",\"Google Drive\"]', '2023-02-13 06:33:25', '2023-02-13 07:38:43'),
(18, 1, 'Business Accounting', '36', NULL, '<p>Explore the world of the professional accountant and take your first step towards a career in Accounting. This module is developed in conjunction with leading academics and industry veterans, to guarantee superior content without exception.</p>\r\n<p><strong>Learning Outcomes:</strong></p>\r\n<ul>\r\n<li>Preparation of Financial Statements.</li>\r\n<li>Recording of day to day accounting transactions.</li>\r\n<li>Clarity on accounting fundamentals.</li>\r\n<li>Banking and vendor/customer ledger reconciliation</li>\r\n</ul>', NULL, '[\"Introduction\",\"Accounting Concepts\",\"Capital & Revenue Transactions\",\"Accounts Documents\",\"Journal Entries\",\"Depreciation\",\"Stock Valuation\",\"Year-end Adjustments\",\"Final Accounts\",\"Rectification of Errors\",\"BRS\",\"Projects on preparation of Books of Accounts Online Journal Entry Test \\u2013 JET\"]', '2023-02-13 06:33:25', '2023-02-13 07:38:43'),
(19, 1, 'TallyPrime', '51', NULL, '<p>Tally Prime is widely used end to end complete accounting platform</p>\r\n<ul>\r\n<li>Day to Day accounting entries</li>\r\n<li>Treatments of GST and TDS</li>\r\n<li>Payroll Management</li>\r\n<li>Inventory Management</li>\r\n<li>Various Financial Reporting</li>\r\n<li>GST Returns</li>\r\n</ul>', NULL, '[\"Company creation\",\"Cost Centre & Cost Category\",\"Accounting\",\"Inventory\",\"Bill of Materials (BOM)\",\"Purchase & Sales Cycle\",\"Basic concepts of GST\",\"GST using Tally\",\"Generation of Returns\",\"TDS\",\"PF\",\"Backup and Restore\",\"Payroll\",\"Security\",\"Reports\"]', '2023-02-13 06:33:25', '2023-02-15 07:48:09'),
(20, 1, 'Business Communication', '45', NULL, '<p>It is said &ldquo;If there is one skill that you need to build if you want to become a leader &ndash; It is Communication&rdquo;<br /><strong>Learning Outcomes:<br /><br /></strong></p>\r\n<ul>\r\n<li>Communication and behavioral skills</li>\r\n<li>Time Management</li>\r\n<li>Presentation and Public Speaking</li>\r\n<li>Workplace and e-mail etiquette</li>\r\n</ul>', NULL, '[\"Assertive Communication\",\"Non-verbal Communication\",\"Presentation Skills\",\"Interview Skills\",\"Sell Your Skills\",\"(Cover Letter, Resume Designing)\",\"People Skills (Workplace Behavior)\",\"E-mail \\u00c9tiquette\",\"Goal Setting and Time Management\"]', '2023-02-13 06:33:25', '2023-02-15 07:48:09'),
