(70, 8, 'TallyPrime', '51 Hours', NULL, '<p>TallyPrime is widely used end to end complete accounting platform.</p>\r\n<p><strong>Learning Outcomes:<br /></strong></p>\r\n<ul>\r\n<li>Day to Day accounting entries</li>\r\n<li>Treatments of GST and TDS</li>\r\n<li>Payroll Management</li>\r\n<li>Inventory Management</li>\r\n<li>Various Financial Reporting</li>\r\n<li>GST Returns</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, '[\"Company creation\",\"Cost Centre & Cost Category\",\"Accounting\",\"Inventory\",\"Bill of Materials (BOM)\",\"Purchase & Sales Cycle\",\"Basic concepts of GST\",\"GST using TallyPrime\",\"Generation of Returns\",\"TDS\",\"PF\",\"Backup and Restore\",\"ESI\",\"Payroll\",\"Security\",\"Reports\"]', '2023-03-20 07:17:28', '2023-03-20 07:20:50');
INSERT INTO `faqs` (`id`, `question`, `answer`, `model`, `model_id`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Are there any eligibility requirements for the Data Science Course?', '<p>To join the Data Science course by ICA Edu Skills, you must have completed your graduation from a renowned university.&nbsp;</p>', '[\"CourseType\"]', '4', '1', '2023-02-18 05:21:12', '2023-02-21 05:28:25'),
(2, 'Why Should I Learn Data Science?', '<p>Data Science is forecasted to become a 77 billion dollar industry by 2023. Honing in-demand skills such as this can help in landing a lucrative package.</p>', '[\"CourseType\"]', '4', '1', '2023-02-18 05:24:19', '2023-02-21 06:47:02'),
(3, 'How can I avail the Job-Guarantee?', '<ul>\r\n<li>Must complete their graduation in any stream.</li>\r\n<li>ICA shall only be assisting the candidates in finding a paid internship in case of students pursuing graduation or are undergraduate after completion of course.</li>\r\n<li>ICA has placement offices across 30+ cities with a huge employer base. Our priority will be to place the candidate within the city nearest to their place. In case of vacancies not arising during the specific time, we shall be providing the opportunities across other cities.</li>\r\n<li>Students must clear all the assessments post completion of every such module followed by one common/final exam towards the end.</li>\r\n<li>If a student is found using malpractice/unfair means, he will be suspended.</li>\r\n<li>In case of Student&rsquo;s knowledge is not found sufficient, ICA may call the student to appear for assessment in person at the center.</li>\r\n</ul>', '[\"Center\",\"Course\"]', NULL, '1', '2023-02-18 05:24:19', '2023-02-21 05:36:18'),
(4, 'How does the Job Assurance Program Work?', '<p>The individual must:&nbsp;</p>\r\n<ul>\r\n<li>Have completed their graduation from any domain.</li>\r\n<li>ICA has placements in more than 30 cities spanning across India. We will try to place the candidates nearest to their hometown. However, if there are no vacancies during that certain period, we shall provide placement opportunities in other cities.&nbsp;</li>\r\n<li>Students must be able to clear all the assessments post completion of every such module with an examination at the end.&nbsp;</li>\r\n</ul>', '[\"CourseType\"]', '4', '1', '2023-02-21 06:40:55', '2023-02-21 06:40:55'),
(5, 'What is the Salary of a Data Scientist in India?', '<p>A data scientist can learn up to Rs. 4 Lakhs and with experience, this salary will keep increasing.&nbsp;</p>', '[\"CourseType\"]', '4', '1', '2023-02-21 06:42:59', '2023-02-21 06:42:59'),
(6, 'What equipment do we need to join the course?', '<ul>\r\n<li>For Classroom training nothing is required as our classrooms are well equipped with high end computers &amp; stable internet connection</li>\r\n<li>Smartphones are required to access the e-content.</li>\r\n</ul>', '[\"Course\"]', NULL, '1', '2023-02-21 06:49:59', '2023-02-21 06:49:59'),
(7, 'How will my examinations be conducted?', '<ul>\r\n<li>For Classroom training examinations will be conducted in the center only.</li>\r\n<li>Common / Final exam will be conducted after completion of all the modules and their assessments.</li>\r\n<li>Student identity validation and surveillance is a must during the exam time.</li>\r\n<li>Non-submission of assessments in time will be considered as if not attempted.</li>\r\n</ul>', '[\"Course\"]', NULL, '1', '2023-02-21 06:50:22', '2023-02-21 06:50:22'),
(8, 'Who is eligible for these courses?', '<ul>\r\n<li>Minimum 10+2 qualified</li>\r\n<li>Pursuing Graduation</li>\r\n</ul>', '[\"Course\"]', NULL, '1', '2023-02-21 06:51:03', '2023-02-21 06:51:03'),
(9, 'How can I avail the Job-Guarantee?', '<ul>\r\n<li>Must complete their graduation in any stream.</li>\r\n<li>ICA shall only be assisting the candidates in finding a paid internship in case of students pursuing graduation or are undergraduate after completion of course.</li>\r\n<li>ICA has placement offices across 30+ cities with a huge employer base. Our priority will be to place the candidate within the city nearest to their place. In case of vacancies not arising during the specific time, we shall be providing the opportunities across other cities.</li>\r\n<li>Students must clear all the assessments post completion of every such module followed by one common/final exam towards the end.</li>\r\n<li>If a student is found using malpractice/unfair means, he will be suspended.</li>\r\n<li>In case of Student&rsquo;s knowledge is not found sufficient, ICA may call the student to appear for assessment in person at the center.</li>\r\n</ul>', '[\"Course\"]', NULL, '1', '2023-02-21 06:51:33', '2023-02-21 06:51:33');
