(1, '1', 'Senior Academic Counselor', '<ul>\r\n<li>Calling on Digital Leads and convert them into Admission Courses</li>\r\n<li>Counseling the students to achieve their future goals</li>\r\n<li>Ensuring Target achievement by coordinating with the team</li>\r\n<li>Must have strong Communication Skill (both written and verbal) -English, Hindi, &amp; Bengali</li>\r\n</ul>', 'Kolkata', 'Full Time', '2 years Experience', '15k - 25k', 1, '2023-03-13 05:18:10', '2023-03-13 05:18:10'),
(2, '2', 'SEO (Search Engine Optimization)\'s SPECIALIST', '<p><strong>KEY SKILLS :</strong></p>\r\n<ul>\r\n<li>(Dedicated SEO) Specialist</li>\r\n<li>SEO Score Scaling</li>\r\n<li>Analysis and SEO Marketer</li>\r\n<li>Lead Generation</li>\r\n</ul>', 'Kolkata', 'Full Time', '3-5 Years', '15k - 25k', 1, '2023-03-13 05:20:15', '2023-03-13 06:42:53'),
(3, '4', 'Senior Developer', '<ul>\r\n<li>Proficient in ASP.Net and MS SQL Server</li>\r\n<li>Must have knowledge in ASP.Net web forms</li>\r\n<li>Good to have knowledge in ASP.Net MVC</li>\r\n</ul>', 'Kolkata(Head Office)', 'Full Time', '3 - 5 Years', '15k - 25k', 1, '2023-03-13 06:48:44', '2023-03-13 06:48:44'),
(4, '5', 'Senior Graphics / Video Executive', '<p><strong>KEY SKILLS:</strong></p>\r\n<ul>\r\n<li>Knowledge of Print and Digital Graphics</li>\r\n<li>Knowing Adobe and Corel Graphics Software</li>\r\n<li>Video Editing, Image Correction</li>\r\n<li>Fine Arts Knowledge Preferred</li>\r\n</ul>', 'Kolkata (Head Office)', 'Full Time', '2-5 Years', '15k - 25k', 1, '2023-03-13 06:51:18', '2023-03-13 06:53:37');
