(7, 'Blogs', 'Accounts, GST, SAP, Tally Training | Blogs | ICA Edu Skills', 'blogs', NULL, '<p><span style=\"color: #4d5156; font-family: Helvetica, Arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Accounts, GST, SAP, Tally Training - A knowledge hub for the students who want to aspire a successful career in Accounts, GST, SAP &amp; Tally.</span></p>', 'blog', 1, 'Accounts, GST, SAP, Tally Training - A knowledge hub for the students who want to aspire a successful career in Accounts, GST, SAP & Tally.', NULL, 'index, follow', NULL, 'Blog-Google-Organic', 'SEO', 1, '2023-03-04 02:55:12', '2023-03-04 02:55:12'),
