INSERT INTO `testimonials` (`id`, `featured_image`, `name`, `course_id`, `dasignation`, `comment`, `video`, `model`, `model_id`, `status`, `created_at`, `updated_at`) VALUES
(1, '31', 'Khalid Rehman', '1', 'Multinational Travel Agency in Kenya', '<p>\"ICA gave me a golden opportunity to work abroad. After completing the CIA course in Accounts and Finance, I am working in one of the most reputed travel agencies in Kenya...\"</p>', NULL, '\"Course\"', '1', '1', '2023-02-15 06:56:51', '2023-03-01 02:16:59'),
(2, '30', 'Debankit Dey', '1', 'Placed at PWC', '<p>\"<strong>Before joining ICA,</strong> I had zero confidence level. Thanks to rigorous mock interview sessions I was able to crack all the interview rounds and today my dream to work in an MNC came true...\"</p>', NULL, '\"Course\"', '1', '1', '2023-02-15 06:57:45', '2023-03-01 02:13:25'),
(4, '29', 'Iftasham Islam', '1', 'Placed at ITC Limited', '<p>\"I always heard from people that <strong>ICA</strong> is the best institute to get trained and placed as an Accounts &amp; Finance professional. Today I earnestly advise other accounting aspirants to join here and kickstart their career in this field...\"</p>', 'https://www.youtube.com/watch?v=-g4TnixUdSc', '\"Course\"', '1', '1', '2023-02-15 07:30:51', '2023-03-01 02:16:22'),
(5, NULL, 'Bitoo Kumar Singh', '1', 'Placed at ITC Limited', '<p>\"I always heard from people that <strong>ICA</strong> is the best institute to get trained and placed as an Accounts &amp; Finance professional. Today I earnestly advise other accounting aspirants to join here and kickstart their career in this field...\"</p>', 'https://www.youtube.com/watch?v=-g4TnixUdSc', '\"\\\"Center\\\"\"', NULL, '1', '2023-02-15 07:30:51', '2023-03-13 07:36:14');
INSERT INTO `universities` (`id`, `name`, `title`, `slug`, `banner_image`, `featured_image`, `description`, `state_id`, `city_id`, `enable_otp`, `meta_description`, `schema`, `robots`, `canonical`, `utm_campaign`, `utm_source`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Techno India University', 'Techno India University | College Course', 'graduation-courses-techno-india-university', NULL, NULL, '<p>Techno India University welcomes you to explore the Insights into Technology and Innovation. The fully-fledged university is committed to quality-based education &amp; transforming the aspirants into dynamic, socially perceptive, and responsible citizens as well as excellent professionals in several sectors.&nbsp; The university intended with numerous study programs in science, humanities, commerce, engineering, architecture, management, law, and health sciences, one can avail of courses after the 12th.</p>', 35, 6600, 1, 'Techno India University welcomes you to explore the Insights into Technology and Innovation', NULL, 'index, follow', NULL, 'Google-Organic', 'SEO', 1, '2023-02-03 06:52:32', '2023-02-03 06:52:32'),
(2, 'Sister Nivedita University', 'Sister Nivedita University | College Courses', 'snu-university', NULL, NULL, '<p>Sister Nivedita University has entered into a strategic alliance with ICA Edu Skills Pvt Ltd which is a pioneer in the field of Finance, Accounts, Banking, and Taxation training to provide a Bachelor of Commerce &ndash; B.Com (H) in Banking &amp; Finance &amp; BBA in Finance &amp; Marketing classroom program at the Centurion University campus which is undoubtedly one of the best innovative thinking, and by stimulating entrepreneurial skills one can get courses after 12th in Commerce.</p>', 35, 6600, 1, 'Sister Nivedita University provides high-quality education with academics in both nationally and internationally.', NULL, 'index, follow', NULL, 'Google-Organic', 'SEO', 1, '2023-02-03 07:01:30', '2023-02-03 07:01:30'),
(3, 'Sharda University', 'Sharda University | Degree Course', 'degree-courses-sharda-university', NULL, NULL, '<p><span style=\"font-weight: 400;\">Sharda University has entered into a strategic alliance with ICA Edu Skills Pvt Ltd which is a pioneer in the field of Finance, Accounts, Banking, and Taxation training to provide a Bachelor of Commerce &ndash; </span><a href=\"https://www.icajobguarantee.com/Admissions_Sharda_University/\"><span style=\"font-weight: 400;\">B.Com (H) in Finance &amp; Accounts</span></a><span style=\"font-weight: 400;\"> classroom program at the Sharda University campus which is undoubtedly one of the best courses after 12th in Commerce.</span></p>', 33, 6610, 1, 'The journey of Sharda University (SU) began in the year 2005', NULL, 'index, follow', NULL, 'Google-Organic', 'SEO', 1, '2023-02-03 07:03:46', '2023-02-03 07:03:46'),
(4, 'Royal Global University', 'Royal Global University | College University', 'commerce-college-royal-global-university', NULL, NULL, '<p>The Royal Global University has entered into a strategic alliance with ICA Edu Skills Pvt Ltd which is a pioneer in the field of Finance, Accounts, Banking and Taxation training to provide Bachelor of Commerce - B.Com (H) in Finance &amp;amp; Accounts classroom programme at the Royal Global University campus which is undoubtedly one of the best courses after 12th in Commerce stream.</p>', 4, 2805, 1, 'Guwahati based Royal Global University (RGU), officially established as The', NULL, 'index, follow', NULL, 'Google-Organic', 'SEO', 1, '2023-02-03 07:06:09', '2023-02-03 07:06:09'),
(5, 'G D Goenka University', 'G D Goenka University | College Course', 'bcom-course-gd-goenka-university', NULL, NULL, '<p><span style=\"font-weight: 400;\">G D Goenka University has entered into a strategic alliance with ICA Edu Skills Pvt Ltd which is a pioneer in the field of Finance, Accounts, Banking, and Taxation training to provide a Bachelor of Commerce &ndash; B.Com (H) in Finance &amp; Accounts classroom program at the G D Goenka University campus which is undoubtedly one of the best courses after 12th in Commerce stream.</span></p>', 13, 1092, 1, 'The G D Goenka Education City is spread over 60 acres amidst the scenic foothills of the Aravalli Range.', NULL, 'index, follow', NULL, 'Google-Organic', 'SEO', 1, '2023-02-03 07:07:30', '2023-02-07 00:19:51');
